            <Header />
            <Home />
            <Footer />
          </Route >
          <Route path="/suppliers">
            <Header />
            <Suppliers />
            <Footer />
          </Route >
          <Route path="/items">
            <Header />
            <Items />
            <Footer />
          </Route >
          <Route path="/employeeData">
            <Header />
            <EmployeesData />
            <Footer />
          </Route >
        </Switch> */}
      </Router>
    </div>
  );
}

export default memo(App);
